import React, { useState } from 'react';

function Profile() {
  // Sample user data - in a real app, this would come from state or API
  const [user, setUser] = useState({
    name: 'John Doe',
    email: 'john.doe@example.com',
    profilePicture: '../images/',
    bio: 'Travel enthusiast and adventure seeker.',
    travelPreferences: {
      favoriteDestinations: ['Paris', 'Tokyo', 'New York'],
      preferredActivities: ['Hiking', 'Sightseeing', 'Local Cuisine'],
      travelStyle: 'Adventure',
    },
  });

  const [isEditing, setIsEditing] = useState(false);
  const [editedUser, setEditedUser] = useState(user);

  const handleEdit = () => {
    setIsEditing(true);
    setEditedUser(user);
  };

  const handleSave = () => {
    setUser(editedUser);
    setIsEditing(false);
  };

  const handleCancel = () => {
    setIsEditing(false);
    setEditedUser(user);
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    setEditedUser({ ...editedUser, [name]: value });
  };

  return (
    <div className="container mx-auto px-4 py-8">
      <div className="max-w-4xl mx-auto bg-white rounded-lg shadow-md p-6">
        <h1 className="text-3xl font-bold text-gray-800 mb-6">User Profile</h1>
        
        <div className="flex flex-col md:flex-row items-start space-y-6 md:space-y-0 md:space-x-8">
          {/* Profile Picture and Basic Info */}
          <div className="flex flex-col items-center md:items-start">
            <img
              src={user.profilePicture}
              alt=""
              className="w-32 h-32 rounded-full object-cover mb-4"
            />
            <h2 className="text-2xl font-semibold text-gray-700">{user.name}</h2>
            <p className="text-gray-600">{user.email}</p>
          </div>

          {/* Profile Details */}
          <div className="flex-1">
            <div className="mb-6">
              <h3 className="text-xl font-semibold text-gray-700 mb-2">About</h3>
              {isEditing ? (
                <textarea
                  name="bio"
                  value={editedUser.bio}
                  onChange={handleChange}
                  className="w-full p-2 border border-gray-300 rounded-md"
                  rows="3"
                />
              ) : (
                <p className="text-gray-600">{user.bio}</p>
              )}
            </div>

            <div className="mb-6">
              <h3 className="text-xl font-semibold text-gray-700 mb-2">Travel Preferences</h3>
              <div className="space-y-2">
                <div>
                  <span className="font-medium">Favorite Destinations: </span>
                  <span className="text-gray-600">{user.travelPreferences.favoriteDestinations.join(', ')}</span>
                </div>
                <div>
                  <span className="font-medium">Preferred Activities: </span>
                  <span className="text-gray-600">{user.travelPreferences.preferredActivities.join(', ')}</span>
                </div>
                <div>
                  <span className="font-medium">Travel Style: </span>
                  <span className="text-gray-600">{user.travelPreferences.travelStyle}</span>
                </div>
              </div>
            </div>

            <div className="mb-6">
              <h3 className="text-xl font-semibold text-gray-700 mb-2">Account Settings</h3>
              <div className="space-y-2">
                {isEditing ? (
                  <>
                    <div>
                      <label className="block text-sm font-medium text-gray-700">Name</label>
                      <input
                        type="text"
                        name="name"
                        value={editedUser.name}
                        onChange={handleChange}
                        className="w-full p-2 border border-gray-300 rounded-md"
                      />
                    </div>
                    <div>
                      <label className="block text-sm font-medium text-gray-700">Email</label>
                      <input
                        type="email"
                        name="email"
                        value={editedUser.email}
                        onChange={handleChange}
                        className="w-full p-2 border border-gray-300 rounded-md"
                      />
                    </div>
                  </>
                ) : (
                  <div className="space-y-2">
                    <div>
                      <span className="font-medium">Name: </span>
                      <span className="text-gray-600">{user.name}</span>
                    </div>
                    <div>
                      <span className="font-medium">Email: </span>
                      <span className="text-gray-600">{user.email}</span>
                    </div>
                  </div>
                )}
              </div>
            </div>

            {/* Edit/Save/Cancel Buttons */}
            <div className="flex space-x-4">
              {isEditing ? (
                <>
                  <button
                    onClick={handleSave}
                    className="bg-blue-500 text-white px-4 py-2 rounded-md hover:bg-blue-600"
                  >
                    Save
                  </button>
                  <button
                    onClick={handleCancel}
                    className="bg-gray-500 text-white px-4 py-2 rounded-md hover:bg-gray-600"
                  >
                    Cancel
                  </button>
                </>
              ) : (
                <button
                  onClick={handleEdit}
                  className="bg-green-500 text-white px-4 py-2 rounded-md hover:bg-green-600"
                >
                  Edit Profile
                </button>
              )}
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Profile;
